  false,\n\t\"url\": null,\n\t\"notes\": \"The USGS US Topo Availability service from
  The National Map consists of footprints where US Topo products are currently available.
  Various green tints are used to reflect the year in which US Topo map products have
  been published. The service is updated daily and contains the same data used in
  footprints in the Map Locator & Downloader application program interface used in
  the USGS Store (http://store.usgs.gov). In addition to access through The National
  Map download client (http://viewer.nationalmap.gov/basic), US Topo products and
  other USGS publications are available through the USGS Store. For additional information,
  go to http://nationalmap.gov/ustopo\",\n\t\"license_title\": null,\n\t\"extras\":
